import Link from 'next/Link';
const Navigation = () => {
    return(
        <ul>
            <li> <Link href="/"><a>Index</a></Link></li>
            <li> <Link href="/abobut"><a>About</a></Link></li>
            <li>Services</li>
        </ul>
    )
}
export default Navigation;
